package com.leetcode.bytedance;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Map;
import java.util.stream.Collectors;
import java.util.stream.Stream;

/**
 * @Author milindeyu
 * @Date 2022/6/23 9:11 下午
 * @Version 1.0
 */
public class Demo438 {

    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> rsp = new ArrayList<>();
        int sLen = s.length(), pLen = p.length();
        if (sLen < pLen) return rsp;

        // 使用数组记录每个字符出现的次数
        int[] pNums = new int[26];
        int[] sNums = new int[26];
        for (int i = 0; i < pLen; i++) {
            ++pNums[p.charAt(i) - 'a'];
            ++sNums[s.charAt(i) - 'a'];
        }

        if (Arrays.equals(pNums, sNums)) rsp.add(0);

        for (int i = 0; i < sLen - pLen; i++) {
            // s上的窗口滑动
            --sNums[s.charAt(i) - 'a'];
            ++sNums[s.charAt(i + pLen) - 'a'];

            if (Arrays.equals(pNums, sNums)) rsp.add(i + 1);
        }
        return rsp;
    }

    public static void main(String[] args) {
        Demo438 demo438 = new Demo438();
        System.out.println(demo438.findAnagrams("",
                ""));
    }
}
